import React from 'react'
export default function Table(props) {






  return (
    <div>
        <table className='table'>
            {props.list.map(task => {
                return (
                    <tr  className='tr'> 
                        <td>{task.tName}</td>
                        <td>{task.tAssigee}</td>
                    </tr>
                )
            })}
        </table>
    </div>
  )
}
